query personDetails ($personID: String!){
  personDetails(personID: $personID) {
    entityId,
    industry,
    topLevelIndustry,
    title,
    jobFunction,
    employmentHistory {
      companyName,
      from,
      to,
      jobFunction,
      title,
      level,
      companyID,
      companyWebsite
    }
    education {
      school,
      degree {
        areaOfStudy,
        degree
      }
    }
    webReference {
      description,
      title,
      url,
      date
    },
    boardMember {
      from,
      to,
      jobFunction,
      title,
      level,
      company {
        id,
        name,
        tagged,
        masked,
        subscribed,
        exported,
        description,
        domain,
        logo,
        fax,
        phone,
        ticker,
        crmEntityId,
        address {
          Street,
          City,
          State,
          Zip,
          street,
          city,
          state,
          zip,
          country,
          latitude,
          longitude,
          CountryCode
        },
        displayAddress,
        employeeCount,
        revenue,
        doziIndustry {
          displayName,
          name,
          isPrimary,
          score
        },
        doziIndustryString,
        revenueRange,
        isDefunct,
        uniqueCompanyNumContacts,
        companyHref,
        isInPreview,
        funding {
          amountIn000s,
          date,
          type,
          investors {
            companyName
          }
        }
        departmentBudgets {
          departmentType,
          budgetAmount
        }
        certified,
        certificationDate,
        icpScore,
        locationsCount,
        ultimateParent: basicUltimateParent,
        orgImport
      },
    }
    personBiography,
    socialUrls {
      socialMedia {
        followerCount,
        socialNetworkType,
        socialNetworkUrl
      }
    },
    socialUrlsParsed {
      linkedin,
      facebook,
      twitter,
      youtube
    },
    followerCountParsed {
      linkedin,
      facebook,
      twitter,
      youtube
    }
    foundedYear,
    alexaRank,
    directPhoneIsDoNotCall,
    mobilePhoneIsDoNotCall,
    company {
      id,
    },
    importedData {
      date,
      owners {
        key,
        value {
          date,
          crmEntityId,
          ownerId,
          ownerName
        }
      }
    }
  }
}

query scoopsSearch($companyIds: String!) {
  scoopsSearch(
    companyIds: $companyIds
  ) {
            publishedDate
            description,
            scoopTypes:types{scoopType},
            originalPublishedDate,
            id,
            updatedText,
            personRecords 
                {
                    personId,
                    firstName,
                    lastName
                },
            company{masked,domain,id,companyName:name,subscribed,domain,certified,type},
            scoopTopics:topics{scoopTopic},
            imageUrl,
            orgImport
      } 
}

