query facets ($companyId: String!){
      facets (companyId: $companyId) {
        orgChartFacets (companyId: $companyId)
          {
            facets
            {
                name,
                counts{
                    id,
                    count,
                    name
                }
            }
         }
        }
      }

query companyHierarchySearch($companyIds: String!) {
  companyHierarchySearch(companyIds: $companyIds)
  {
        familyTree{
            city,
            familyNodes{
                city,
                id,
                name,
                subUnitTypeInfo{type},
                familyNodes{
                    city,
                    id,
                    name,
                    subUnitTypeInfo{type}, 
                      familyNodes{
                      city,
                      id,
                      name,
                      subUnitTypeInfo{type},
                        familyNodes{
                            city,
                            id,
                            name,
                            subUnitTypeInfo{type},
                            familyNodes{
                                city,
                                id,
                                name,
                                subUnitTypeInfo{
                                    type
                                },
                            }                  
                        }  
                    }
                },           
            },
            id,
            name,
            subUnitTypeInfo{
                type
            },            
        },
            ultimateParent{
                id,
                name
            }
  }
}

query companyPeopleQuickSearch ($rpp: Float!,$quickSearch: String){
     companyPeopleQuickSearch (rpp: $rpp, quickSearch: $quickSearch)       
         {
           success,
           companies{
               companiesCount,
               data{
                   companyDomain,
                   companyEmployeeRange,
                   companyID,
                   companyName,
                   industries{
                       code,
                       displayName,
                       score
                   },
                   isDefunct,
                    location{
                       City,
                       CountryCode,
                       State,
                       Street,
                       Zip
                   },
                   logo,
                   socialNetworkUrls{
                       socialNetworkType,
                       socialNetworkUrl
                   },
                   ultimateParent{
                       id
                   },                  
               }
               maxResults,
               totalResults
           }
           contacts{
               companiesCount,
               data{
                   companyId,
                   companyName,
                   isDefunct,
                   logo,
                   name,
                   personID,
                   title,
                   ultimateParent{
                       id
                   }
               },
                maxResults,
               totalResults
           },
           onEnterTops{
               type,
               value
           },
           tops{
               topCount,
               topName,
               topValue,
               type,
               value
           },
           trySearchSuggestions{
               items{
                   displayItem,
                   searchType,
                   suggestions{
                       type,
                       value
                   }
               },
               showAdditionalTrySearches
           }
        }
       }

