     suggestions (rpp: $rpp) {
       companySuggestion (rpp: $rpp)
         {
          companiesCount,
          data{
              certificationDate,
              certified,
              companyDescription,
              companyDomain,
              companyID,
              companyIds,
              companyLogo,
              companyName,
              companyPhone,
              companyRevenueIn000s,
              companyType,
              doziIndustry{
                  displayName,                   
                  isPrimary,
                  score
              },
              employees,
              employeesRange,
              funding{
                  amountIn000s,
                  date,
                  round,
                  investors{
                      investorName,
                      investorDomain
                  }
              },
              isDefunct,
              isMasked,
              isTagged,
              location{
                  City,
                  CountryCode,
                  State,
                  Street,
                  Zip
              },
              orgUniversalTagged {
                  tagName,
                  value
              },
              revenue,
              revenueRange,
              subscribed,
              topLevelIndustry,
              totalFundingAmountIn000s,
              universalTagged{
                  tagName,
                  value
              },
              website
          },
          maxResults,
          totalResults
        }
       }
     }
